import './App.css';
import React, { useState } from "react";
import { Drawer, Button, List, ListItem } from "@material-ui/core";


function App() {

  const [openNav, setOpenNav] = useState(false);

  const openDrawer = (e) => {
    e.preventDefault();
    setOpenNav(!openNav)
    console.log(openNav)
  }

  const page = ["Contact", "About", "Prenatal", "Labor and Birth", "Newborn"]

  return (
    <div className="App">
      <Button onClick={openDrawer}>Menu</Button>
      <Drawer anchor="left" open={openNav}>
        <List>
          {page.map(item => (
            <ListItem>
              <Button>{item}</Button>
            </ListItem>
          ))}
        </List>
      </Drawer>
    </div>
  );
}

export default App;
